import React from "react";
import styled from "styled-components";
import blueTriangle from "../misc/images/tr_2.png";
const BlueTriangleSource = <img src={blueTriangle} alt="blue_triangle" />;

const StyledBlueTriangle = styled(BlueTriangleSource)`
  width: 100%;
  height: 100%;
`;

// const Wra

export {StyledBlueTriangle};
